class Audio {
  getInfo() {
    return {
      id: 'audio', // change this if you make an actual extension!
      name: 'Audio',
      blocks: [
        {
          opcode: 'audioplay',
          blockType: Scratch.BlockType.COMMAND,
          text: 'start play audio'
        }
      ]
    };
  }
  audioplay() {
	new Audio('data:audio/wav;base64,').play();
    return 0;
  }
}
Scratch.extensions.register(new Audio());
